import React from "react";
import '../home.css'
function Home() {
    return (
        <>
            <div className="inspirational_mentors">
                <h2>Meet Our Inspirational Mentors</h2>
                <p>Discover the Mentors who are ready to guide, inspire, and empower you. Get to know our accomplished experts and find the perfect Mentors to help you reach your goals.</p>
<Cards/>
            </div>
        </>
    )
}
export default Home;

function Cards() {
    return (
        <>
            <h1>Kaushik</h1>
        </>
    )
}
